// import logo from './logo.svg'
import './App.css'
import legs_and_fire from './legs_and_fire2.jpg'

function App() {
  return (
    <div className='App'>
      <Flex>
        <Box boxSize='sm'>
          <Image src={legs_and_fire} alt='Dan Abramov' />
        </Box>
      </Flex>
    </div>
  )
}

export default App
